import './App.css';
import "../node_modules/bootstrap/dist/css/bootstrap.min.css"
import Navbar from './components/Navbar';
import { BrowserRouter, Route, Link } from 'react-router-dom';
import homeCasa from './screens/homeCasa';

function App() {
  return (
    <div className="App">
      <Navbar />
      <BrowserRouter>

      <Route path="/homeCasa" exact Component={homeCasa} />

      </BrowserRouter>
    </div>
  );
}

export default App;
